import React from "react";
import { Card, Image } from "semantic-ui-react";
import pokemon from "images/pokemon-destek.png";
import { useSelector } from "react-redux";
import { getUserElements, getCardElements } from "store/selectors";
import turtles from "images/turtles.png";

const DefaultUser: React.FC = () => {
  const user = useSelector(getUserElements);
  const { userId, email, password, accessToken } = useSelector(getCardElements);
  return (
    <React.Fragment>
      <img
        src={turtles}
        alt=""
        style={{
          position: "absolute",
          right: "0",
          width: "auto%",
          height: "100%",
        }}
      />
      <Card centered>
        <Image
          src={pokemon}
          wrapped
          ui={false}
          label={
            user.environment !== ""
              ? {
                  as: "a",
                  color: user.environment === "Test" ? "red" : "blue",
                  content: user.environment === "Test" ? "TEST" : "STAGE",
                  ribbon: true,
                }
              : null
          }
        />
        <Card.Content>
          <Card.Header>Pokemon Destek</Card.Header>
          <Card.Meta>
            <span>Ash Ketchum</span>
          </Card.Meta>
          <Card.Description>
            I wanna be the very best like no one ever was
          </Card.Description>
        </Card.Content>
        <Card.Content extra textAlign="center">
          <div>{userId ? userId : "nothing"}</div>
          <div>{email ? email : "nothing"}</div>
          <div>{password ? password : "nothing"}</div>
          <div>{accessToken ? "var" : "nothing"}</div>
        </Card.Content>
      </Card>
    </React.Fragment>
  );
};

export default DefaultUser;
